script: |
  super -f text -I q10267.spq | sort > q10267.out

inputs:
  - name: q10267.spq
    data: |
      SELECT ALL * FROM tab1 (FORMAT parquet) WHERE + col2 NOT BETWEEN - 63 AND + col0 / 99 + - col0 + col2 * - 94 / CAST ( NULL AS REAL ) + - - 81 + ( - col2 );
  - name: tab1

outputs:
  - name: q10267.out
    data: |
